script: |
  super -f text -I q13175.spq | sort > q13175.out

inputs:
  - name: q13175.spq
    data: |
      SELECT + 21 - col1 FROM tab2 (FORMAT parquet) cor0 WHERE NOT + col0 NOT BETWEEN ( - col1 / 89 ) AND + col2 * ( 12 ) + col1;
  - name: tab2

outputs:
  - name: q13175.out
    data: |
      -30
      -46
      -56
